import React from "react";
import styled from "styled-components";
import theme from "../../Logic/theme";

const { primary, secondary, tri, quad, background, primaryFont } = theme;

const Container = styled.div`
  grid-area: misc;
  width: 100%;
  margin-top: 0.5em;
  max-height: 10em;
  display: flex;
  flex-wrap: wrap;
  justify-content: space-evenly;
`;

const Box = styled.div`
  width: 5em;
  height: 5em;
  margin: 0.5em;
  background-color: #fff;
  border: 3px solid ${primary};
  border-radius: 5px;
  :hover {
    cursor: pointer;
    background-color: ${secondary};
  }
`;

const StyledP = styled.p`
  font-size: 1em;
  margin-top: 0.3em;
`;

const BotomP = styled.p`
  font-size: 1em;
  margin-top: -2em;
`;

const Stat = styled.p`
  font-family: "Dosis";
  color: ${primary};
  font-size: 2em;
  margin-top: -0.65em;
`;

const MiscStats = ({ misc }) => {
  return (
    <Container>
      <Box>
        <StyledP>Armor</StyledP>
        <Stat>{misc.ac}</Stat>
        <BotomP>Class</BotomP>
      </Box>
      <Box />
      <Box />
      <Box />
    </Container>
  );
};

export default MiscStats;
